import React from 'react';

const FormRenderer = ({ questions }) => {
  return (
    <div className="p-4 bg-gray-50">
      <h2 className="text-xl font-bold mb-4">Rendered Form</h2>
      {questions.map((question, index) => (
        <div
          key={index}
          className="border p-4 rounded-md shadow-md mb-4 bg-white"
        >
          {question.type === 'categorized' && (
            <div>
              <h3 className="font-bold mb-2">Categorized Question</h3>
              <p className="font-semibold">Categories:</p>
              <ul className="mb-2 list-disc pl-6">
                {question.data.categories.map((category, idx) => (
                  <li key={idx}>{category}</li>
                ))}
              </ul>
              <p className="font-semibold">Options:</p>
              <ul className="list-disc pl-6">
                {question.data.options.map((option, idx) => (
                  <li key={idx}>{option}</li>
                ))}
              </ul>
            </div>
          )}
          {question.type === 'cloze' && (
            <div>
              <h3 className="font-bold mb-2">Cloze Question</h3>
              <p>{question.data.text}</p>
              <div>
                <p className="font-semibold">Fill in the blanks:</p>
                {question.data.blanks.map((blank, idx) => (
                  <input
                    key={idx}
                    type="text"
                    placeholder={`Blank ${idx + 1}`}
                    className="border p-2 rounded-md mr-2 mb-2"
                  />
                ))}
              </div>
            </div>
          )}
          {question.type === 'comprehension' && (
            <div>
              <h3 className="font-bold mb-2">Comprehension Question</h3>
              <p className="mb-2">{question.data.text}</p>
              {question.data.mcqs.map((mcq, idx) => (
                <div key={idx} className="mt-2">
                  <p className="font-semibold">{mcq.question}</p>
                  <ul className="list-disc pl-6">
                    {mcq.options.map((option, optIdx) => (
                      <li key={optIdx}>{option}</li>
                    ))}
                  </ul>
                </div>
              ))}
            </div>
          )}
        </div>
      ))}
    </div>
  );
};

export default FormRenderer;
